text:
Trump's Big Bill for Billionaires gets uglier by the day.

@USCBO once again confirmed that the Republican health care plan will cause 15 million Americans to lose coverage &amp; raise premiums for millions more. 

We are all paying the price for Trump's giveaways to billionaires.

Ways and Means passed the Republican budget bill, which threatens millions of Americans' health care.

Not long ago, it seemed like the Affordable Care Act would be repealed, but it was saved by a single vote.

@RepJimmyGomez, @WaysMeansCmte, and I won't stop fighting. https://t.co/ucvjIwZZdP

It's 2 AM and we're still here fighting for working families.

@WaysMeansCmte Dems just offered an amendment to cut taxes for middle-class families and make the ultra-rich pay their fair share instead.

Republicans just voted it down — because they only care about billionaires. https://t.co/agWmar6Ihy

Donald Trump and the Republicans have blown up the debt with their giveaways to the ultra-rich.

@SenWhitehouse and I have a better idea.

We're introducing the Paying a Fair Share Act to ensure our tax code puts working families first. https://t.co/Nvup4fy1ZR

.@RepCleaver and @RepDavids, you’re on. You’ll both have to learn to never bet against Philly.

@RepDwightEvans, @RepMGS, and I are looking forward to enjoying some of your Kansas City barbecue after Saquon and the Eagles feast on the Chiefs.

GO BIRDS! #FlyEaglesFly
